    )
    User.save()
    .then((doc) => {
        console.log(doc);
        return res.redirect('/secret');
    })
    .catch((err) => {
        console.log(err);
        res.json({
            "message": 'an error occured'
        })
    })
}

const login = (req, res, next) => {

    let username = req.body.username;
    let password = req.body.password;

    UserModel.findOne({
        "username": username,
        "password": password
    }, function(err, user) {
        if (err) {
            console.log(err);
